// *Footer
// -CopyRight
// -Links
// Address,Contact
const Header = () => {
  return (
    <div className="header">
      <div className="logo-container">
        <img
          className="logo"
          src="https://www.logodesign.net/logo/smoking-burger-with-lettuce-3624ld.png?size=2"
          alt=""
        />
      </div>
      <div className="nav-item">
        <ul>
          <li>Home</li>
          <li>About Us</li>
          <li>Contact Us</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};
const ResturantCard = ({ MENU_DATA,key}) => {
  console.log("MENU_DATA", MENU_DATA, "KEY",key);
  const { name, cuisines, costForTwo, avgRating, cloudinaryImageId } =
    MENU_DATA?.data;
  // console.log("props", props);
  // const { resName, cuising, rating, time }=props
  return (
    <div className="restaurant-card" style={{ backgroundColor: "#f0f0f0" }}>
      <img
        className="res-img"
        src={
          "https://media-assets.swiggy.com/swiggy/image/upload/" +
          cloudinaryImageId
        }
        alt={"logo" + "food"}
      />
      <h4>{name}</h4>
      <h4>{cuisines.join(",")}</h4>
      <h4>{costForTwo / 100}</h4>
      <h4>{avgRating}</h4>
    </div>
  );
};
const Footer = () => {
  return (
    <>
      <div className="footer">
        <h1>Footer</h1>
      </div>
    </>
  );
};
